<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Reporte de HIT</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            background-color: #f4f4f4;
            color: #333;
            margin: 0;
            padding: 20px;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
        }

        .report-container {
            background-color: #fff;
            padding: 30px;
            border-radius: 8px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
            max-width: 600px;
            width: 100%;
        }

        .report-header {
            text-align: center;
            border-bottom: 2px solid #e76c07;
            padding-bottom: 15px;
            margin-bottom: 20px;
        }

        .report-header h1 {
            font-size: 24px;
            color: #e76c07;
            margin: 0;
        }

        .report-content p {
            margin: 10px 0;
            font-size: 16px;
        }

        .report-content p strong {
            color: #333;
        }

        .report-footer {
            margin-top: 20px;
            text-align: center;
            font-size: 14px;
            color: #777;
        }

        .report-footer img {
            margin-top: 10px;
            max-width: 150px; /* Ajusta el tamaño según sea necesario */
            height: auto;
        }
    </style>
</head>
<body>
    <div class="report-container">
        <div class="report-header">
            <h1>Reporte de HIT</h1>
        </div>
        <div class="report-content">
            <p><strong>Primer Nombre:</strong> PRUEBA</p>
           
        </div>
        <div class="report-footer">
            <p>Reporte generado automáticamente por el Sistema de Identificación Dactilar</p>
            <img src="data:image/png;base64," alt="Logo de la Empresa">
        </div>
    </div>
</body>
</html>
